import React from "react";
import {Card, Grid, GridColumn, CardContent} from "semantic-ui-react";


function People( {data} ) {
    return (
        <>
            <h1>People</h1>
            <Grid columns={3}>
                {data.map((people,i) => {
                    return(
                        <GridColumn key={i}>
                            <Card>
                                <CardContent>
                                    
                                </CardContent>
                            </Card>
                        </GridColumn>
                    )
                })}
            </Grid>
        </>
    )
}
export default People;
